And then it is used there 
```
func build_dict(
    list : KeyValue*,
    dict : DictAccess*,
    steps : felt
) -> (dict : DictAccess*):

    alloc_locals

    if steps == 0:
        return (dict=dict)
    end

    let (local prev_value : felt*) = alloc()
    let (local new_value : felt*) = alloc()

    %{
        # Populate ids.dict.prev_value using cumulative_sums...
        prev_value = ids.dict.new_value | 0 #ERROR HERE

        # Add list.value to cumulative_sums[list.key]...
        new_value = (ids.dict.new_value | 0) + ids.list.value

    %}
    # Copy list.key to dict.key...
    # Verify that dict.new_value = dict.prev_value + list.value...
    # Call recursively to build_dict()...
    return build_dict(
        list=list + 1,
        dict=dict + 1,
        steps = steps - 1
    )
end
```
So at my first call of `prev_value = ids.dict.new_value | 0` I get `starkware.cairo.lang.vm.memory_dict.UnknownMemoryError: Unknown value for memory cell at address 5:1.`, I guess because it is not initialized and the value can't be accessed

