Hello! I did "Field elements" exercise in Cairo Playground but had an issue getting it to work. To illustrate, I added only one line, `let(res) = pow(10, 74)` to original code here:

`%builtins output
from starkware.cairo.common.serialize import serialize_word
# Computes base^exp.
func pow(base : felt, exp : felt) -> (res):
    if exp == 0:
        return (res=1)
    end
    let (res) = pow(base=base, exp=exp - 1)
    return (res=res * base)
end

func main{output_ptr : felt*}():
    serialize_word(1 + 100)
    # Add your code here.
    let (res) = pow(10, 74)
    return ()
end`

This returns errors. However, if I add `{output_ptr : felt*}` to `func pow`, then it runs fine:

`%builtins output
from starkware.cairo.common.serialize import serialize_word
# Computes base^exp.
func pow{output_ptr : felt*}(base : felt, exp : felt) -> (res):
    if exp == 0:
        return (res=1)
    end
    let (res) = pow(base=base, exp=exp - 1)
    return (res=res * base)
end

func main{output_ptr : felt*}():
    serialize_word(1 + 100)
    # Add your code here.
    let (res) = pow(10, 74)
    return ()
end`

Or, the code also runs fine if I remove the line `serialize_word(1 + 100)` inside `func main` (and `func pow` does not need the implicit argument `output_ptr` in this case).

I don't understand why `func pow` needs `{output_ptr : felt*}` since `serialize_word` is called only in `func main`. Any thoughts? Thx ðŸ˜Š

